import './App.css';
import React from "react";
import Student from './Student'

function App() {

  const student = {
    name: 'John Doe',
    birthdate: '01/01/2000',
    zodiacSign: 'Capricorn',
    favoriteMovieOrTVShow: 'Breaking Bad',
    hobbies: 'Playing guitar, reading, hiking',
    futureGoal: 'Become a software engineer',
    futureIn20Years: 'Living in a log cabin in the woods'
  };

  return (
    <div className='app'>
      <div className="cover">
        <div className="cover-text">
          <h1>PSI C Weekly Newspaper</h1>
          <img src="https://www.shutterstock.com/image-vector/vector-shield-icon-600w-523861894.jpg" alt="School logo" />
          <p>12/04/20 - 14/04/20</p>
        </div>
      </div>
      <div className="meeting-corner">
        <div className="meeting-corner-title">Meeting Corner</div>
        <Student data={student} />
      </div>
    </div>
  );
}

export default App;
